import React from 'react'

const Dashboard = () => {
  const handleLogout = () => {
    localStorage.removeItem("token");
  }
  
  return (
    <div>
      <h2>Dashboard</h2>
      <button type="button" typeonClick={handleLogout}>Log Out</button>
    </div>
  )
}

export default Dashboard
